@eduaxx @filgmartin Estranho ver vcs preocupados com ÁUDIOS, sendo q os partidos que vcs ADMIRAM estão sempre envolvidos com "ÁUDIOS CABULOSOS"

Mas isso vcs não veem

Ah, e pra fechar, já descobriram QUEM MATOU MARIELLE...vão se desculpar por CULPAR PESSOAS INOCENTES ???

—Hay tantas cosas mal, que no sabría por dónde empezar.

El caso del suicida y el rehén ha traído de vuelta esa inquietud y terror que habita de forma subyacente en su memoria.

Sonríe escuetamente a Cece, porque no pretende cargar a nadie con problemas que son solo suyos. &gt;&gt;

@mlukacs Buen punto Miklos.

En cierto momento Mijael tuvo suficientes recursos y un ambiente más amigable para ayudar con un cambio para bien. 
Hoy en día no se si tendrá alguna utilidad o si se va a quemar totalmente postulando al congreso. Francamente me parece suicida postular.

@itxshazam No primeiro filme: As trocas de olhares, na cena que po Richie fala que o Bill beijou a Bev, numa peça.
No segundo filme: As reações do Bill, ao descobrir que o Stan se suicidou, e ao ler a carta dele. 
Algo me diz que Bill gostava do Stan, e era reciproco
